import {Routes, Route} from 'react-router-dom' ; 
import About from "./pages/About";

function Main()  { 
return ( 
<Routes> 
<Route path="/" element= {<div>Main Page</div>}    /> 
<Route path="/about" Component= {About}    /> 
</Routes>
) ; 
}
 export default Main ;
